if mibBuilder.loadTexts: tmnxOamPingCtlRowStatus.setDescription("This object allows entries to be created and deleted in the tmnxOamPingCtlTable. Deletion of an entry in this table results in all corresponding (same tmnxOamPingCtlOwnerIndex and tmnxOamPingCtlTestIndex index values) tmnxOamPingResultsTable and tmnxOamPingHistoryTable entries being deleted. Activation of a Alcatel 7x50 SR OAM ping operation is controlled via tmnxOamPingCtlAdminStatus and not by changing this object's value to active(1). The values for configuration objects required for the type of test specified in tmnxOamPingCtlTestMode MUST be specified prior to a transition to active(1) state being accepted. Transitions in and out of active(1) state are not allowed while an entry's tmnxOamPingResultsOperStatus is active(1) with the exception that deletion of an entry in this table by setting its RowStatus object to destroy(6) will stop an active Alcatel 7x50 SR OAM ping operation. The operational state of an Alcatel 7x50 SR OAM ping operation can be determined by examination of its tmnxOamPingResultsOperStatus object.")
