if mibBuilder.loadTexts: tmnxOamPingCtlRespSdpId.setDescription("Specifies the return SDP-ID to be used by the far-end node for its message reply. This parameter is optional and is valid only if tmnxOamPingCtlTestMode has a value of 'sdpPing'. If this SDP-ID does not exist on the far-end, terminates on another node different than the originating node, or some other issue prevents the far-end from using the specified SDP-ID, the OAM Echo message reply is sent using generic IP/GRE OAM encapsulation. The received forwarding class (as mapped on the ingress network interface for the far-end) defines the forwarding class encapsulation for the reply message.")
tmnxOamPingCtlFcName = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 11, 1, 3, 1, 10), TFCName().clone('be')).setMaxAccess("readcreate")
if mibBuilder.loadTexts: tmnxOamPingCtlFcName.setStatus('current')
if mibBuilder.loadTexts: tmnxOamPingCtlFcName.setDescription("The value of tmnxOamPingCtlFcName specifies the forwarding class. This parameter is optional and is valid only if tmnxOamPingCtlTestMode has a value of 'sdpPing', 'macPing', 'lspPing' or 'vccvPing. For 'sdpPing' or 'macPing' this is the forwarding class of the SDP encapsulation. For 'lspPing' this is the forwarding class of the LSP tunnel. For 'vccvPing' this is the forwarding class of the pseudowire. The forwarding class name must be one of those defined in the tFCNameTable in ALCATEL-IND1-TIMETRA-QOS-MIB. The agent creates predefined entries in the tFCNameTable for 'premium', 'assured', and 'be' (for best-effort) forwarding classes. The actual forwarding class encoding is controlled by the network egress DSCP or LSP-EXP mappings.")
