tmnxOamPingCtlMtuStepSize = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 11, 1, 3, 1, 14), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(1, 512)).clone(32)).setUnits('Octets').setMaxAccess("readcreate")
