if mibBuilder.loadTexts: tmnxOamPingCtlLocalSdp.setDescription("When the value of tmnxOamPingCtlLocalSdp is 'true', the 'svcPing' test determines an egress SDP-ID that is bound to the service that has the far-end IP address specified in tmnxOamPingCtlTgtAddress assigned to it. The far-end address of the specified SPD-ID is the expected responder-id within the OAM Echo reply message. The SDP-ID defines the encapsulation of the SDP tunnel encapsulation used to reach the far-end. This can be IP/GRE or MPLS. On the originator egress, the Service-ID must have an associated VC-Label to reach the far-end address of the SDP-ID and the SDP-ID must be operational for the message to be sent. This object is optional and valid only when tmnxOamPingCtlTestMode is equal to 'svcPing'.")
tmnxOamPingCtlRemoteSdp = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 11, 1, 3, 1, 19), TruthValue().clone('false')).setMaxAccess("readcreate")
