if mibBuilder.loadTexts: tmnxOamPingCtlRemoteSdp.setDescription("When the value of tmnxOamPingCtlRemoteSdp is 'false', the far-end node must use the generic IP/GRE OAM encapsulation as the return path in a 'svcPing' test. This object is optional and valid only when tmnxOamPingCtlTestMode is equal to 'svcPing'.")
tmnxOamPingCtlSize = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 11, 1, 3, 1, 20), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 16384)).clone(72)).setUnits('octets').setMaxAccess("readcreate")
if mibBuilder.loadTexts: tmnxOamPingCtlSize.setStatus('current')
if mibBuilder.loadTexts: tmnxOamPingCtlSize.setDescription("The value of tmnxOamPingCtlSize specifies the size of the OAM Echo message. When tmnxOamPingCtlTestMode has a value of 'mtuPing', changing the message size is a method of checking the ability of an SDP to support a particular path-mtu value. The size of the message does not include the SDP encapsulation, VC-Lable (if applied) or any DLC headers or trailers. When the OAM message is encapsulated in an IP/GRE SDP, the IP 'DF' (Don't Fragment) bit is set. If any segment of the path between the sender and receiver cannot handle the message size, the message is discarded. MPLS LSPs are not expected to fragment the message either, as the message contained in the LSP is not an IP packet. In the case of 'lspPing' the minimum size allowed is 84 octets. In the case of 'vccvPing' the minimum size allowed is 88 octets. In the case of 'sdpPing' the minimum size allowed is 72 octets. Before 6.0 release, the minimum size in 'sdpPing' is 40 octets. Such shorter packet has no timestamp information but should still be accepted for interoperability purpose. However, new 'sdpPing' should include the timestamp information. In the case of 'icmpPing' the minimum size allowed is 0 octet. In the case of 'macPing', 'mfibPing' and 'vprnPing' the minimum size allowed is 1 octet. In the case of all the test types except 'icmpPing' the maximum size allowed is 9198 octets. In the case of 'icmpPing' the maximum size allowed is 16384 octets. When tmnxOamPingCtlTestMode has a value of 'icmpPing', the value of this object specifies the payload size following the ICMP header. The default size for 'icmpPing' is 56 octets. This parameter is optional and is valid only if tmnxOamPingCtlTestMode has a value of either 'sdpPing' ,'mtuPing', 'macPing', 'lspPing', 'vprnPing', 'mfibPing', 'vccvPing' or 'icmpPing'.")
tmnxOamPingCtlTimeOut = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 11, 1, 3, 1, 21), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(1, 10)).clone(5)).setUnits('seconds').setMaxAccess("readcreate")
if mibBuilder.loadTexts: tmnxOamPingCtlTimeOut.setStatus('current')
if mibBuilder.loadTexts: tmnxOamPingCtlTimeOut.setDescription("The value of tmnxOamPingCtlTimeOut specifies the time-out value, in seconds, to wait for an OAM Echo message reply. Upon expiration of the timeout period, the agent assumes that the message response will not be received. An appropriate error value is written to tmnxOamPingHistoryStatus for the timed out probe entry. Any response received after the timeout period has expired is silently discarded. This parameter is optional and is valid only if tmnxOamPingCtlTestMode has a value of either 'sdpPing', 'mtuPing', 'macPing', 'lspPing', 'vprnPing', 'atmPing', 'mfibPing', 'vccvPing', 'icmpPing' or 'dnsPing'.")
tmnxOamPingCtlProbeCount = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 11, 1, 3, 1, 22), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(1, 100000)).clone(1)).setUnits('probes').setMaxAccess("readcreate")
