if mibBuilder.loadTexts: tmnxOamPingCtlProbeCount.setDescription("Specifies the number of times to perform an OAM ping probe operation. Each OAM Echo message request must either timeout or receive a reply before the next message request is sent. This parameter is optional and is valid only if tmnxOamPingCtlTestMode does not have a value of 'mtuPing'. The maximum value for all ping test modes other than icmp-ping is 100. The default probe count value for 'icmpPing' is 5.")
tmnxOamPingCtlInterval = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 11, 1, 3, 1, 23), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(1, 10000)).clone(1)).setUnits('seconds').setMaxAccess("readcreate")
if mibBuilder.loadTexts: tmnxOamPingCtlInterval.setStatus('current')
if mibBuilder.loadTexts: tmnxOamPingCtlInterval.setDescription("The number of seconds to wait before sending the next OAM Echo request message. If tmnxOamPingCtlInterval has a value of 1 and tmnxOamPingCtlTimeOut has a value of 10 seconds, then the maximum time between message requests is 10 seconds and the minimum is 1 second. For test types other than 'icmpPing', the maximum interval is 10 seconds. For 'icmpPing' when tmnxOamIcmpPingCtlRapid has a value of 'true', the UNITS for tmnxOamPingCtlInterval is '10 milliseconds' in order to allow rapid intervals less than 1 second to be specified.")
