if mibBuilder.loadTexts: tmnxOamTrCtlRowStatus.setDescription("This object allows entries to be created and deleted in the tmnxOamTrCtlTable. Deletion of an entry in this table results in all corresponding (same tmnxOamTrCtlOwnerIndex and tmnxOamTrCtlTestIndex index values) tmnxOamTrResultsTable, tmnxOamTrProbeHistoryTable, and tmnxOamTrHopsTable entries being deleted. The values for configuration objects required for the type of test specified in tmnxOamTrCtlTestMode MUST be specified prior to a transition to active(1) state being accepted. Activation of an Alcatel 7x50 SR OAM Trace Route operation is controlled via tmnxOamTrCtlAdminStatus and not by transitioning of this object's value to active(1). Transitions in and out of active(1) state are not allowed while an entry's tmnxOamTrResultsOperStatus is active(1) with the exception that deletion of an entry in this table by setting its RowStatus object to destroy(6) will stop an active Alcatel 7x50 SR OAM Trace Route operation. The operational state of an Alcatel 7x50 SR OAM Trace Route operation can be determined by examination of the corresponding tmnxOamTrResultsOperStatus object.")
