tmnxOamTrCtlFcName = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 11, 2, 3, 1, 8), TFCName().clone('be')).setMaxAccess("readcreate")
if mibBuilder.loadTexts: tmnxOamTrCtlFcName.setStatus('current')
if mibBuilder.loadTexts: tmnxOamTrCtlFcName.setDescription("The value of tmnxOamTrCtlFcName specifies the forwarding class. This parameter is optional. For 'macTraceRoute this is the forwarding class of the SDP encapsulation. For 'lspTraceRoute' this is the forwarding class of the LSP tunnel. The forwarding class name must be one of those defined in the tFCNameTable in ALCATEL-IND1-TIMETRA-QOS-MIB. The agent creates predefined entries in the tFCNameTable for 'premium', 'assured', and 'be' (for best-effort) forwarding classes. The actual forwarding class encoding is controlled by the network egress DSCP or LSP-EXP mappings. This parameter is not defined for 'vprnTraceRoute', 'mcastTraceRoute' and 'icmpTraceRoute'.")
