tmnxOamTrCtlDataSize = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 11, 2, 3, 1, 12), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(1, 9198)).clone(1)).setUnits('octets').setMaxAccess("readcreate")
if mibBuilder.loadTexts: tmnxOamTrCtlDataSize.setStatus('current')
if mibBuilder.loadTexts: tmnxOamTrCtlDataSize.setDescription("The value of tmnxOamTrCtlDataSize specifies the size of the data portion of an Alcatel 7x50 SR OAM Trace Route request in octets. The size of the message does not include the SDP encapsulation, VC-Lable (if applied) or any DLC headers or trailers. When the OAM message is encapsulated in an IP/GRE SDP, the IP 'DF' (Don't Fragment) bit is set. If any segment of the path between the sender and receiver cannot handle the message size, the message is discarded. MPLS LSPs are not expected to fragment the message either, as the message contained in the LSP is not an IP packet. This parameter is optional. In the case of 'lspTraceRoute' the minimum size is 104 octets. In the case of 'lspTraceRoute' with multipath DSMap the minimum size is 140 octets. In the case of 'macTraceRoute' the minimum size is 1 octet. In the case of 'vprnTraceRoute' the minimum size is 1 octet. In the case of 'vccvTraceRoute' the minimum size is 88 octets. This parameter is not used by 'mcastTraceRoute' or 'icmpTraceRoute'.")
tmnxOamTrCtlTimeOut = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 11, 2, 3, 1, 13), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(1, 60)).clone(3)).setUnits('seconds').setMaxAccess("readcreate")
