tmnxOamTrCtlProbesPerHop = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 11, 2, 3, 1, 14), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(1, 10)).clone(1)).setUnits('probes').setMaxAccess("readcreate")
