tmnxOamTrCtlDSField = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 11, 2, 3, 1, 17), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 255))).setMaxAccess("readcreate")
if mibBuilder.loadTexts: tmnxOamTrCtlDSField.setReference('Refer to RFC 2474 for the definition of the Differentiated Services Field and to RFC 1812 Section 5.3.2 for Type of Service (TOS).')
if mibBuilder.loadTexts: tmnxOamTrCtlDSField.setStatus('current')
if mibBuilder.loadTexts: tmnxOamTrCtlDSField.setDescription("The value of tmnxOamTrCtlDSField specifies the value to store in the Differentiated Services (DS) Field in the IP packet used to encapsulate the Alcatel 7x50 SR OAM Trace Route probe. The DS Field is defined as the Type of Service (TOS) octet in a IPv4 header or as the Traffic Class octet in a IPv6 header. The value of this object must be a decimal integer in the range from 0 to 255. This option can be used to determine what effect an explicit DS Field setting has on a oam traceroute response. Not all values are legal or meaningful. DS Field usage is often not supported by IP implementations. A value of 0 means that the function represented by this option is not supported. Well known TOS octet values are '16' (low delay) and '8' (high throughput). This parameter is optional. This parameter is not used by 'macTraceRoute', 'lspTraceRoute', 'mcastTraceRoute' or 'vccvTraceRoute'.")
tmnxOamTrCtlMaxFailures = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 11, 2, 3, 1, 18), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 255)).clone(5)).setUnits('timeouts').setMaxAccess("readcreate")
if mibBuilder.loadTexts: tmnxOamTrCtlMaxFailures.setStatus('current')
if mibBuilder.loadTexts: tmnxOamTrCtlMaxFailures.setDescription("The value of tmnxOamTrCtlMaxFailures specifies the maximum number of consecutive timeouts allowed before terminating an Alcatel 7x50 SR OAM Trace Route request. This parameter is optional. A value of either 255 (maximum hop count/possible TTL value) or a 0 indicates that the function of terminating an Alcatel 7x50 SR OAM Trace Route request when a specific number of successive timeouts are detected is disabled. This parameter is optional. This parameter is not used by 'icmpTraceRoute'.")
tmnxOamTrCtlInterval = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 11, 2, 3, 1, 19), Unsigned32().clone(1)).setUnits('seconds').setMaxAccess("readcreate")
if mibBuilder.loadTexts: tmnxOamTrCtlInterval.setStatus('current')
if mibBuilder.loadTexts: tmnxOamTrCtlInterval.setDescription("The value of tmnxOamTrCtlInterval specifies the number of seconds to wait before repeating an Alcatel 7x50 SR OAM Trace Route test as defined by the value of the various objects in the corresponding row. This parameter is optional. The number of hops in a single Alcatel 7x50 SR OAM Trace Route test is determined by the value of the corresponding tmnxOamTrCtlProbesPerHop object. After a single test completes, the number of seconds as defined by the value of tmnxOamTrCtlInterval MUST elapse before the next Alcatel 7x50 SR OAM Trace Route test is started. A value of 0 for this object implies that the test as defined by the corresponding entry will not be repeated. This parameter is not used by 'icmpTraceRoute'.")
tmnxOamTrCtlMaxRows = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 11, 2, 3, 1, 20), Unsigned32().clone(300)).setUnits('rows').setMaxAccess("readcreate")
if mibBuilder.loadTexts: tmnxOamTrCtlMaxRows.setStatus('current')
if mibBuilder.loadTexts: tmnxOamTrCtlMaxRows.setDescription('The value of tmnxOamTrCtlMaxRows specifies the maximum number of entries allowed in the tmnxOamTrProbeHistoryTable. The oldest entry in the tmnxOamTrProbeHistoryTable is removed to allow the addition of an new entry once the number of rows in the tmnxOamTrProbeHistoryTable reaches this value. Old entries are not removed when a new test is started. Entries are added to the tmnxOamTrProbeHistoryTable until tmnxOamTrCtlMaxRows is reached before entries begin to be removed. A value of 0 for this object disables creation of tmnxOamTrProbeHistoryTable entries.')
tmnxOamTrCtlTrapGeneration = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 11, 2, 3, 1, 21), Bits().clone(namedValues=NamedValues(("pathChange", 0), ("testFailure", 1), ("testCompletion", 2)))).setMaxAccess("readcreate")
