tmnxOamTrCtlCreateHopsEntries = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 11, 2, 3, 1, 22), TruthValue().clone('false')).setMaxAccess("readcreate")
