if mibBuilder.loadTexts: tmnxOamTrCtlCreateHopsEntries.setDescription('The value of tmnxOamTrCtlCreateHopsEntries specifies whether or not the current path for an Alcatel 7x50 SR OAM Trace Route test is kept in the tmnxOamTrHopsTable on a per hop basis. tmnxOamTrHopsTable provides a current path topology based on the results of the OAM Trace Route tests. If this feature is not supported tmnxOamTrCtlCreateHopsEntries will always be set to false(2) and any attempt to change its value to true(1) will be denied.')
tmnxOamTrCtlSAA = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 11, 2, 3, 1, 23), TruthValue().clone('false')).setMaxAccess("readcreate")
