if mibBuilder.loadTexts: tmnxOamTrCtlSAA.setDescription("The value of tmnxOamTrCtlSAA specifies whether or not to collect Service Assurance Agent, SAA, metrics such as loss, jitter and latency. When tmnxOamTrCtlSAA has a value of 'true', SAA metrics are collected. This parameter is optional.")
tmnxOamTrCtlRuns = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 11, 2, 3, 1, 24), Counter32()).setMaxAccess("readonly")
